import React from 'react';
import ReactDOM from 'react-dom';
import CommentDetail from './CommentDetail';

const App=() => {
    return (
    <div className="ui comment container">
        <CommentDetail author="sam" timeago="today at 4:45PM"/>
        <CommentDetail author="rainy" timeago="today at 6:00PM"/>
        <CommentDetail author="bob" timeago="today at 11:45AM"/>
        <CommentDetail author="tom" timeago="today at 3:00PM"/>
        <CommentDetail author="anna" timeago="today at 8:30PM"/>
        <CommentDetail author="bill" timeago="today at 4:48PM"/>
    </div>

    );
};
ReactDOM.render(<App/>,document.querySelector('#root'));
